import "./portfolio.scss";

export default function Portfolio() {
  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>
      <ul>
        <li>Featured</li>
      </ul>
      <div className="container">
        <div className="item">
          <img
            src="https://raw.githubusercontent.com/oddporson/tweeter/master/public/docs/tweeter-mobile-view.png"
            alt=""
          />
          <h3>Tweeter</h3>
        </div>
      </div>
    </div>
  );
}
